const Images = {
  portfolio: {
    portfolio00: require("./portfolio00.jpg"),
    portfolio01: require("./portfolio01.jpg"),
    portfolio02: require("./portfolio02.jpg").default,
  },

  profile: {
    profile00: require("./profile00.jpg").default,
    profile01: require("./profile01.jpg").default,
  },

  services: require("./services.jpg").default,
}

export default Images
